import React from 'react';
import { MDBBtn, MDBCard, MDBCardBody, MDBCardImage, MDBCardTitle, MDBCardText, MDBCol } from 'mdbreact';

const CardExample = () => {
  return (
    <MDBCol>
      <MDBCard style={{ width: "22rem" }}>
       
        <MDBCardBody>
            <MDBCardImage>
                
            </MDBCardImage>
            {/* <img src='https://scontent.fccu10-1.fna.fbcdn.net/v/t1.0-9/13087386_1757894184423597_172695294762548029_n.jpg?_nc_cat=105&_nc_ohc=C36wKPRe7uAAX-7GNSx&_nc_ht=scontent.fccu10-1.fna&oh=bf0383f91e6b9ecd1a080a31be39bdca&oe=5EB6608E' /> */}
          <MDBCardTitle>Card title</MDBCardTitle>
          <MDBCardText>
            Some quick example text to build on the card title and make
            up the bulk of the card&apos;s content.
          </MDBCardText>
         
        </MDBCardBody>
      </MDBCard>
    </MDBCol>
  )
}

export default CardExample;
